import styled from 'styled-components';

export const Container = styled.div`
 position: absolute;
 left: 13px;
 top: 95px;
 width: 580px;
 height: 380px;
 background-color:#f1f1f18a;

 h4{
     position:relative;
     top:100px;
     text-align: center;
     font-size: 20px;
     font-family: 'Hina Mincho';
 }
`;
export const ImgCard = styled.div`
 width:580px;
 img{
     position: relative;
     left:10px;
     width:100%;
 }
`;
